window.bookSummaryJSON = "<p>Reunited with her people, Shanti knows that she must make a move in order to finally put her duty to rest. But as always, Xandre is one step ahead of her. </p> <p>For one brief moment, when she lets down her guard, Shanti falls into enemy hands. But if Xandre thought she would be a docile prisoner, he was sadly mistaken. </p> <p>With Shanti running interference, it is up to the boys she has trained and the army Cayan leads to fight their way to her side. </p> <p>The fate of the land will finally be decided. Which side will be overtaken? </p> <p><i>Overtaken</i> is the final book in the number one best-selling series. </p>"; 
